//------------------------------------------------------
// Blob
//------------------------------------------------------
#pragma declaration

inline float2x2 rotate(float v) {
    float a = cos(v);
    float b = sin(v);
    return float2x2(a,-b,b,a);
}

float smin(float a, float b, float k)
{
    float h = max(k-abs(a-b), 0.0)/k;
    return min(a, b) - h*h*k*(1.0/4.0);
}
half smin(half a, half b, half k)
{
    half h = max(k-abs(a-b), 0.h)/k;
    return min(a, b) - h*h*k*(1.h/4.h);
}
float smax(float a, float b, float k)
{
    return -smin(-a, -b, k);
}
half smax(half a, half b, half k)
{
    return -smin(-a, -b, k);
}

float box(float3 p, float3 b, float r)
{
    float3 q = abs(p) - b + r;
    return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0) - r;
}
half box(half3 p, half3 b, half r)
{
    half3 q = abs(p) - b + r;
    return length(max(q, 0.h)) + min(max3(q.x,q.y,q.z), 0.h) - r;
}

float box2d(float2 p, float2 b, float r)
{
    float2 q = abs(p) - b + r;
    return length(max(q, 0.0)) + min(max(q.x, q.y), 0.0) - r;
}

half box2d(half2 p, half2 b, half r)
{
    half2 q = abs(p) - b + r;
    return length(max(q, 0.h)) + min(max(q.x, q.y), 0.h) - r;
}

half squircle(half2 p, half2 b, half r)
{
    const float continuous_factor = 1.3;
    r *= continuous_factor;
    half2 hs = b - r;

    p = abs(p); 

    if(p.x < hs.x || p.y < hs.y ){
        return box2d(p, b, 0.);
    }

    p-= hs;
    p /= r;

    if( p.y>p.x ) {
        p=p.yx;
    };

    half n = 2.75;
    half w = pow(p.x,n) + pow(p.y,n);

    return (pow(w,1.0h/n) - 1.) * (r);

}



struct Blob {
    const float metaSmooth = 0.12;
    const float metaSize = 0.37;
    const float metaOffset = 0.18;
    const float offsetSpeed = 1.3;
    float3 attractorPos1;
    float3 attractorPos2;
    float3 attractorPos3;
    float3 attractorPos4;
    float3 attractorPos5;
    float3 attractorPos6;
    float4 rectangleData;
    float2 shapeData;


    // Precomputed value before raymarch loop
    float time10;
    float2x2 rot;
    float4 metaPosSize[4];
    float attractorsFade;

    void init(float time, float inertiaRotation, float showAttractors, float4 rectangle, float2 shape) {
        time10 = time*10.;
        rot = rotate(time*0.4*M_PI_2_F + inertiaRotation);

        // precalc metaball pos & size
        float ct = cos(time * offsetSpeed) * metaSize * metaOffset;
        float st = sin(time * offsetSpeed) * metaSize * metaOffset;
        metaPosSize[0] = float4( st*1.1, st,  0.0, metaSize * 1.);
        metaPosSize[1] = float4(-st*1.2, st,  0.21, metaSize * 1.0);
        metaPosSize[2] = float4( st * 1.4, ct * 1.3, -0.2,        metaSize * 1.0);
        metaPosSize[3] = float4( st * 1.2, -ct * 1.2,  0.1,        metaSize  );

        attractorsFade = 0.15 * showAttractors;
        rectangleData = rectangle;
        shapeData = shape;
    }


    half map(half3 p) {
        half d = 0.0, r = 0.0;
        half4 rect = half4(rectangleData);
        half2 shp = half2(shapeData.xy);

        if (rect.w < 1.0) {
            // Metaballs
            half3 pp = half3(half2x2(rot) * p.xy, p.z);
            half d0 = length(pp - half3(metaPosSize[0].xyz)) - half(metaPosSize[0].w);
            half d1 = length(pp - half3(metaPosSize[1].xyz)) - half(metaPosSize[1].w);
            half d2 = length(pp - half3(metaPosSize[2].xyz)) - half(metaPosSize[2].w);
            half d3 = length(pp - half3(metaPosSize[3].xyz)) - half(metaPosSize[3].w);

            half ms = metaSmooth;
            d = smin(d0, d1, ms);
            d = smin(d,d2, ms);
            d = smin(d,d3, ms);
        }
        if (rect.w > 0.0) {
            r = box(p, half3(rect.xy, 0.4h), rect.z);
        }
        d = mix(d, r, rect.w);
        //d = mix(d, shp.x, shp.y);
        return d;
    }

    float map(float3 p) {
        float d = 0.0, r = 0.0;
        float4 rect = float4(rectangleData);
        float2 shp = float2(shapeData.xy);

        if (rect.w < 1.0) {
            // Metaballs
            float3 pp = float3(float2x2(rot) * p.xy, p.z);
            float d0 = length(pp - float3(metaPosSize[0].xyz)) - float(metaPosSize[0].w);
            float d1 = length(pp - float3(metaPosSize[1].xyz)) - float(metaPosSize[1].w);
            float d2 = length(pp - float3(metaPosSize[2].xyz)) - float(metaPosSize[2].w);
            float d3 = length(pp - float3(metaPosSize[3].xyz)) - float(metaPosSize[3].w);

            float ms = metaSmooth;
            d = smin(d0, d1, ms);
            d = smin(d,d2, ms);
            d = smin(d,d3, ms);
        }
        if (rect.w > 0.0) {
            r = box(p, float3(rect.xy, 0.4), rect.z);
        }
        d = mix(d, r, rect.w);
        return d;
    }

    half map2d(half2 p) {
        half d = 0.0, r = 0.0;
        half4 rect = half4(rectangleData);
        half2 shp = half2(shapeData.xy);

        if (rect.w < 1.0) {
            half2 pp = half2x2(rot) * p;
            half d0 = length(pp - half2(metaPosSize[0].xy)) - half(metaPosSize[0].w);
            half d1 = length(pp - half2(metaPosSize[1].xy)) - half(metaPosSize[1].w);
            half d2 = length(pp - half2(metaPosSize[2].xy)) - half(metaPosSize[2].w);
            half d3 = length(pp - half2(metaPosSize[3].xy)) - half(metaPosSize[3].w);

            half ms = metaSmooth;
            d = smin(d0, d1, ms);
            d = smin(d,d2, ms);
            d = smin(d,d3, ms);
        }
        if (rect.w > 0.0)
        {
            //r = box2d(p.xy, rect.xy, rect.z);
            r = squircle(p.xy, rect.xy, rect.z);
        }
        d = mix(d, r, rect.w);
        //d = mix(d, shp.x, shp.y);
        return d;
    }

    half mapAttractors2d(half2 p) {
        half rad = 0.06h;
        half a1 = length(p-half2(attractorPos1.xy)) - rad;
        half a2 = length(p-half2(attractorPos2.xy)) - rad;
        half a3 = length(p-half2(attractorPos3.xy)) - rad;
        half a4 = length(p-half2(attractorPos4.xy)) - rad;
        half a5 = length(p-half2(attractorPos5.xy)) - rad;
        half a6 = length(p-half2(attractorPos6.xy)) - rad;
        a1 += attractorPos1.z;
        a2 += attractorPos2.z;
        a3 += attractorPos3.z;
        a4 += attractorPos4.z;
        a5 += attractorPos5.z;
        a6 += attractorPos6.z;
        half d = min(a1, a2);
        d = min(d, a3);
        d = min(d, a4);
        d = min(d, a5);
        d = min(d, a6);
        return d;
    }

    float trace(float3 ro_i, float3 rd_i) {
        half pd = HALF_MAX;

        half3 ro = half3(ro_i);
        half3 rd = half3(rd_i);
        float t = 0.;
        for(int i=0; i<15; i++) {
            half d = map(rd*t + ro);

            pd = d;
            t += d;

            if (d < 0.005)
                return t;
//            if (t > 5)
//                return t;
        }
        return t;
    }

    float3 normal(float3 p_i, float d) {
        half2 eps = half2(.01h, 0.h);
        half3 n;
        half3 p = half3(p_i);
        n.x = d - map(p-eps.xyy);
        n.y = d - map(p-eps.yxy);
        n.z = d - map(p-eps.yyx);
        return float3(normalize(n));
    }
};

//------------------------------------------------------
// Bindings
//------------------------------------------------------
#pragma arguments
texture2d image;
//texture2d shapeSDF;
texture1d colorLUT;
texture1d colorLUTBottom;
float3 attractor1;
float3 attractor2;
float3 attractor3;
float3 attractor4;
float3 attractor5;
float3 attractor6;
float2 position;
float intertiaRotation;
float scale;
float opacity;
float transitionToBlob;
float transitionToPicture;
float transitionToFinalPicture;
float transitionToRectangle;
float transitionToRectangleProcessing;
float transitionToError;
float transitionToShape;
float showImage;
float3 imageRatio_screenRatio;
float lightMode; //no bool or int in custom properties
float genmojiMode; //no bool or int in custom properties
//float wandMode;
float2 rectangleSize;
float rectangleRadius;
float imageScale;
float2 latencyTimeIntensity;
//float latencyIntensity;
float latencyIntro;
float blobAnimationSpeed;
float2 progress_intensity;

//------------------------------------------------------
// Entry point
//------------------------------------------------------
#pragma body

constexpr sampler smp_lin = sampler(filter::linear, address::repeat);
//constexpr sampler smp_img = sampler(filter::linear, address::clamp_to_edge, mip_filter::linear, filter::linear ,mag_filter::linear, min_filter::linear);
constexpr sampler smp_img = sampler(filter::linear, address::mirrored_repeat, mip_filter::linear, filter::linear ,mag_filter::linear, min_filter::linear);

float time = vfx_frame.time;
float progress = progress_intensity.x;
float progressIntensity = progress_intensity.y;

float imageRatio = imageRatio_screenRatio.x;
float2 screenRation = imageRatio_screenRatio.yz;

// Camera origin & direction
float2 uv = in.fragmentPosition.xy * vfx_frame.inverseResolution;
float3 ro = vfx_frame.inverseViewTransform.columns[3].xyz;


float2 effectPosition = position;
uv = (uv + effectPosition);

//for the wand
float2 shapeUV = uv;
uv += position;
half c = 0;
//half c = shapeSDF.sample(smp_lin, shapeUV).x;

float2 ndc = float2(uv.x*2.-1., (1.-uv.y)*2.-1.) / scale;
float aspect = vfx_frame.projectionTransform.columns[1].y / vfx_frame.projectionTransform.columns[0].x;
float tanHalfFovY = 1.0f / vfx_frame.projectionTransform[1][1];
float3 rd = normalize( (ndc.x * vfx_frame.inverseViewTransform.columns[0].xyz * tanHalfFovY * aspect) + (ndc.y * vfx_frame.inverseViewTransform.columns[1].xyz * tanHalfFovY) - vfx_frame.inverseViewTransform.columns[2].xyz);

// Scene setup
Blob blob;
float rectangleCorner = mix(min(rectangleSize.x, rectangleSize.y),rectangleRadius, transitionToRectangle);
blob.init(vfx_frame.time * blobAnimationSpeed, intertiaRotation, 1. - transitionToPicture, float4(rectangleSize.xy,rectangleCorner, transitionToRectangle), float2(c,transitionToShape));

// Intersection with plane z = 0
half planeT = -half(ro.z)/half(rd.z);

half3 planeP = half3(ro) + half3(rd) * planeT;
planeP = select(planeP, half3(0.00001, 0.0, 0.0), dot(planeP, planeP) == 0.0); // avoid 0 to avoid NaN

half planeD = blob.map2d(planeP.xy);

float genMult = 1;
if (genmojiMode > 0.5)
    genMult = 1.5;
float bgRadius = mix(1.1 * genMult, 7. - (latencyIntro * 2),transitionToRectangle);

if (planeD * bgRadius > 1.h) discard_fragment();

half2 dir = normalize(planeP.xy);
float angle  = atan2(dir.y, dir.x)  / (M_PI_F * 2);

float move_attr = 0.55 + 0.0253 * sin(time * 3. + abs(angle));

blob.attractorPos1 = float3(attractor1.xy*move_attr, attractor1.z); //z is intensity
blob.attractorPos2 = float3(attractor2.xy*move_attr, attractor2.z);
blob.attractorPos3 = float3(attractor3.xy*move_attr, attractor3.z);
blob.attractorPos4 = float3(attractor4.xy*move_attr, attractor4.z);
blob.attractorPos5 = float3(attractor5.xy*move_attr, attractor5.z);
blob.attractorPos6 = float3(attractor6.xy*move_attr, attractor6.z);


half attractors2d = smax(planeD, -blob.mapAttractors2d(planeP.xy), 0.2h);
attractors2d = smin(attractors2d, -planeD, 0.03h);

float4 col = float4(0.);

angle -= time * 0.2;
float4 angle_color = mix(colorLUT.sample(smp_lin, angle * 1), float4(1.), 0.1);


// Lights direction
float lightZ = mix(0.4, 3.5, pow(transitionToShape, 2));

float3 dirl1 = normalize(float3( 0.4, 0.7, lightZ * 0.2));
float3 dirl2 = normalize(float3( 0.4,-0.7, lightZ));
float3 dirl3 = normalize(float3(  -0.7, 0.4, lightZ));

float2 uvImg = float2(planeP.xy);

// Shade
float planeDThreshold = mix(0.005, 0.0025, transitionToRectangle);
if (planeD < planeDThreshold) {
    // Trace
    float t = blob.trace(ro,rd);

    float3 p = ro + rd * t;
    float d = blob.map(half3(p));
    float3 n = blob.normal(p, d);

    // Fake fresnel
    float fre = saturate(1.+dot(rd,n));

    float l1 = pow(max(0., dot(n, dirl1)), 2.);
    float l2 = pow(max(0., dot(n, dirl2)), 2.);
    float l3 = pow(max(0., dot(n, dirl3)), 2.);

    // Lightmasks
    float3 lightmask;
    lightmask.r = smoothstep(0.02,1.,pow(fre,0.5)*l1);
    lightmask.g = smoothstep(0.02,1.,fre*l3);
    lightmask.b = smoothstep(0.02,1.,fre*l2);
    lightmask -= pow(max(0., -n.z), 2.)*.25;
    lightmask = saturate(lightmask);

    // Lightmasks to color LUT
    //attractors light dots
    float attractorIntensity = 1;
    float la = (1. - transitionToPicture) * smoothstep(-0.03, 0.05, float(attractors2d)) * attractorIntensity;
    la *= mix(1, 0.7, lightMode);

    float4 lightcol = 0;

    float tile = 0.4;
    lightcol = lightmask.r * colorLUT.sample(smp_lin, -fre * tile + (time*0.3) * 0.5 + 0.5);
    col = (1.0-lightcol.a) * col + lightcol;

    lightcol = lightmask.g * colorLUT.sample(smp_lin, -fre * tile + (time*0.8) * 0.5);
    col = (1.0-lightcol.a) * col + lightcol;

    lightcol = lightmask.b * colorLUTBottom.sample(smp_lin, -fre * tile + (time*1.1*0.5));
    col = (1.0-lightcol.a) * col + lightcol;

    lightcol = la * mix(angle_color, float4(1.), 0.2 * lightMode) * (1. - genmojiMode);
    col = (1.0-lightcol.a) * col + lightcol;
    col = pow(col, mix(0.55, 0.45, transitionToPicture)); //wrong gamma from color ramps

    //rectangle ramp
    float borderRectangle = smoothstep(-(0.07 + (1.-transitionToRectangle)*.5), 0., float(planeD)); // smooth interior fade
    borderRectangle = pow(borderRectangle, 2);

    float rampUV = atan2(uvImg.y, uvImg.x) - atan2(rectangleSize.y, rectangleSize.x);

    rampUV = fract(rampUV / (M_PI_F * 2.)) - 0.5;

    //latency effect
    float offsetLatency = latencyTimeIntensity.x * M_PI_F * 2. - 1.;
    float2 latencyUV = 0.09 * float2(cos(offsetLatency), sin(-offsetLatency));
    float4 latencyCol = colorLUT.sample(smp_lin, rampUV + 0.45  + latencyTimeIntensity.x) * (1 + latencyIntro);
    latencyCol = pow(latencyCol,0.5);
    float latencyBoxDist = squircle(half2(latencyUV - uvImg), half2(0.75 * rectangleSize.xy), 0.75h * rectangleCorner) * transitionToFinalPicture;
    float latencyInt = 0.5 * pow(smoothstep(-0.25, 0.2, latencyBoxDist), 3.) + 0.75 * borderRectangle * pow(smoothstep(-0.03, 0.05, latencyBoxDist), 2.);
    latencyCol *= saturate(latencyInt * (latencyTimeIntensity.y - 0.5 * latencyIntro));
    latencyCol.a *= 0.75;
    //end latency effect

    rampUV = abs(rampUV);
    rampUV += borderRectangle * 0.3;
    rampUV += fmod(time * -0.35, 1.0);

    lightcol = colorLUTBottom.sample(smp_lin, rampUV);
    lightcol *= borderRectangle*.7;
    if (lightMode > .5)
    {
        latencyCol.a *= 0.65;

        lightcol = pow(lightcol, 0.8);
    }
    else
    {
        latencyCol.a *= 0.8;
    }
    col *= borderRectangle;
    col = mix(col, lightcol, pow(transitionToRectangle, 4));



    col = (1. - latencyCol.a) * col + latencyCol;

    col *= transitionToFinalPicture * (pow(transitionToShape, 5) * 3 + 1);


    //Processing effect
    //put back the color only for rectangle for empty rectangle state
    //waiting for HI specs for the real thing
    float4 process_img = 0;
    float fre2 = saturate(1.+dot(normalize(rd + float3(-0.2,0.6,0)),n));
    process_img += float4(0.2,0.1,0.4, 0.3) * 0.7;
    process_img.a = 1;
    process_img.rgb = lightMode? 0.98:process_img.rgb* ((1 - transitionToRectangle) * 0.2);

    process_img = pow(mix(process_img, pow((colorLUTBottom.sample(smp_lin, -fre2 * 0.6 + (time * 0.3)) * 0.65), 0.9), 0.5 * transitionToRectangle) * 0.25, 0.6);
    process_img.a = lightMode > 0.5 ? 0.55 : 1;


    process_img = mix(process_img, 0.5,transitionToError );

    // Final image
    float4 img = 0.;
    if (genmojiMode < 0.5)
    {
        const float ratio = vfx_frame.inverseResolution.x / vfx_frame.inverseResolution.y;
        //dezoom slightly when in blob state
        float imageScaleUnzoom = imageScale * mix(0.9 ,1,pow(transitionToRectangle, 1));
        //pictures can have different ratio. By default pictures are fit to height
        //but we can zoom them to other ratio with imageRatio to fit them to width
        imageScaleUnzoom *= mix(imageRatio, 1, pow(transitionToRectangle, 1.89));


        float w = vfx_frame.inverseResolution.y / imageRatio;
        float r = w / vfx_frame.inverseResolution.x;
        float off = 0.5 * (1.0 - r);

        float2 imageUV = float2(uv.x * r, uv.y);
        imageUV.x += off;

        imageUV = imageUV * imageScaleUnzoom + 0.5 * (1-imageScaleUnzoom);

        if (imageRatio<1)
            imageUV.y -= 0.15 * mix(imageRatio, 0, pow(transitionToRectangle, 1.5)); //for 1:2 ratio, offset a little bit the picture in y  
        float2 imageUVcentered = imageUV * 2. - 1.;


        const float offsetMult = 1.0;
        float2 uvOffset =  float2(cos(time * 2.2 + 0.3) * 0.007, sin(time * 1.6) * 0.008) * (1-transitionToRectangle) * offsetMult;

        if(transitionToRectangle < 0.999){
            imageUV.xy -= blob.normal(p, d).xy * float2(-1, 1) * pow(fre, 1) * 0.1 * (1-transitionToRectangle);

            //offset for chromatic abherations on the picture borders
            float2 uvColorOffset = -0.06 * imageUVcentered * smoothstep(-0.3, 0.3, float(planeD)) * smoothstep(1., 0.75, transitionToRectangle);
            //offset to smear and expand the outside of the texture 
            uvOffset += -0.1 * imageUVcentered * max(0., length(imageUVcentered - uvOffset) - 0.75) * (1-transitionToRectangle);


            float4 sample1 = image.sample(smp_img, imageUV + uvOffset + uvColorOffset);
            float4 sample2 = image.sample(smp_img, imageUV + uvOffset + 0.5 * uvColorOffset);
            float4 sample3 = image.sample(smp_img, imageUV + uvOffset);
            float4 sample4 = image.sample(smp_img, imageUV + uvOffset - 0.5 * uvColorOffset);
            float4 sample5 = image.sample(smp_img, imageUV + uvOffset - uvColorOffset);
            img.r = sample1.r * 0.3333 + sample2.r * 0.6666;
            img.g = sample3.g * 0.5 + sample2.g * 0.25 + sample4.g * 0.25;
            img.b = sample4.b * 0.6666 + sample5.b * 0.3333;
            img.a = 1.;
        } else {
            img = image.sample(smp_img, imageUV + uvOffset);
        }
        img *= mix(0.1 + 0.9 * smoothstep(1.8, 0.55, length(imageUVcentered)), 1.0, transitionToRectangle);//vignette
        img *= mix(smoothstep(1.05, 0.9, length(imageUVcentered)), 1.0, transitionToRectangle);//outside vignette

        img = mix(process_img, img, transitionToPicture * (1-transitionToRectangleProcessing));
        img *= showImage;
    }

    col = (1.-col.a) * img + col;

    // Sharp exterior fade
    col *=  smoothstep(0.0, planeDThreshold, float(-planeD));
}

// Background: outside ramp
float4 background = float4(0);

if (genmojiMode < 0.5 && (lightMode < .5))
{
    float bgRadius = 4;
    background.a = 0.75 * saturate(pow(planeD <= -0.01 ? 0. : 1. - planeD * bgRadius, 5.));
    background.a *= (1-transitionToRectangle) * 0.5;

}

float3 glow_color = 0.;
//outside ramp
{
    float2 ve = normalize(uv * 0.5 - 0.5);
    float angle  = atan2(ve.y, ve.x)  / (M_PI_F * 2);
    angle += time*0.2;

    float s = mix(-0.005, -0.004, transitionToRectangle);

    background.a += 0.8 * saturate(pow(planeD <= s ? 0. : 1. - planeD * bgRadius, 5.)) * smoothstep(0.0, 1.0, transitionToBlob);

    //compute masks for glow colors, similar to blob lighting to get matching colors
    half3 glowMask;
    glowMask.r = dot(dir, half2(dirl1.xy));
    glowMask.g = dot(dir, half2(dirl2.xy)) + 0.3h;
    glowMask.b = dot(dir, half2(dirl3.xy));
    glowMask = smoothstep(0.02, 1., pow(max(glowMask + 0.3, 0.), 2.));
    background.rgb = colorLUT.sample(smp_lin, .75 + (time*0.3) * 0.5 + 0.5).rgb * glowMask.r; //top right
    background.rgb += colorLUT.sample(smp_lin, .75 + (time*0.8) * 0.5 ).rgb * glowMask.b; //top left
    background.rgb += colorLUTBottom.sample(smp_lin, .75 + (time*1.1*0.5)).rgb * glowMask.g; //bottom right   
    background.rgb /= max(0.000001h, glowMask.r + glowMask.g + glowMask.b);
    background.rgb = pow(background.rgb, 0.8);
    glow_color = background.rgb;

    if (lightMode <0.5)
    {
        background.a *= mix(mix(0.5, 0.4, transitionToPicture), 0.45, transitionToRectangle);
        background *= 1.15 + 0.5 * latencyIntro;
    }
    else
    {
        background.a *= mix(0.45, 0.35, transitionToRectangle);
        background *= 1 + latencyIntro;
    }

    background *= 1-transitionToShape;
    background.rgb *= background.a;

}

//progress + pulse masks
float progress_mask = 1;
float pulse_mask = 0;
float edge_blur_mask = 1;
float3 outline_col = 0;
if (progressIntensity>0)
{
    float fade = mix(0.03, 0.09, saturate(progress * 5)) / length(uvImg);

    float pulse_speed = 0.29;
    progress_mask = fract(-(atan2(uvImg.y, uvImg.x) - (M_PI_F*0.5)) / (M_PI_F * 2.));

    float pulse_ti = fract(time * pulse_speed);
    float pulse_t = smoothstep(0., 0.55, pulse_ti);
    float pulse_t2 = pulse_ti * 2. - 1.;
    pulse_mask = max(0., smoothstep(pulse_t + fade * 0.5, pulse_t - fade * 0.5, progress_mask) * (1. - (smoothstep(fade * 0.5, 0., progress_mask) + smoothstep(1. - fade * 0.5, 1., progress_mask))));

    pulse_mask *= smoothstep(pulse_t2, pulse_t2 + 1., progress_mask);
    pulse_mask = min(1., pulse_mask);


    {
        float t = fract(pulse_ti) * 2 - 1;
        float x = progress_mask+.1;//atan2(uvImg.y, uvImg.x) / 3.1415 * .5 + .5;
        x = fract(x-t*.15);
        float d = (x)+1. - t*2.0;
        float s1 = smoothstep(1.,.85, d);
        float s2 = smoothstep(1.,.85, abs(x*2.-1.));
        float s3 = pow(smoothstep(0.,0.4,length(uvImg)), 2);
        if (d < 0. || d > 1. ) d = 0.;
            pulse_mask = d * s1 * s2 * s3;
        //pulse_mask = pow(pulse_mask, 1.5);  
    }

    progress_mask = fract(progress_mask - 0.25*fade);

    progress_mask = max(smoothstep(progress + fade * 0.5, progress, progress_mask), smoothstep(fade * 0.5, 0., progress_mask)) + smoothstep(1. - fade * 0.5, 1., progress_mask);
    progress_mask = min(progress_mask, 1.);

    progress_mask *= progress < fade ? smoothstep(0., 1., progress / fade) : 1.;
    pulse_mask *= progress_mask;

    half blur_width = 0.04;
    blur_width *= 1. - progress_mask;
    edge_blur_mask = max(progress_mask, float(smoothstep(half(planeDThreshold), -blur_width, planeD)));

    float center_fade = planeD < 0. ? pow(max(0., -pow(-(5.h * planeD), 2.h) + 1.), 5.) : 1.;
    progress_mask *= center_fade; //always fade out center
    center_fade = planeD < 0. ? pow(max(0., -pow(-(1.5h * planeD), 2.h) + 1.), 5.) : 1.;
    pulse_mask *= center_fade;

    float hard_outline = smoothstep(0.003h - 0.5h * blur_width, -0.005h - 0.5h * blur_width, planeD) * smoothstep(-0.0085h - 0.5h * blur_width, 0.0h - 0.5h * blur_width, planeD);
    outline_col = col.rgb * hard_outline * 3. * progress_mask;

    background *= mix(1, pow(saturate(pow(progress_mask, 0.4) * 0.6 + (pulse_mask * 0.1) ) ,1.2), progressIntensity); //NEW
    background.rgb = pow( background.rgb, mix(1, 1.2, progressIntensity)); //NEW
    progress_mask = mix(1, progress_mask * 1, progressIntensity);
    pulse_mask = mix(0, pulse_mask, progressIntensity);
    edge_blur_mask = mix(1, edge_blur_mask, progressIntensity);
    outline_col= mix(0, outline_col, progressIntensity);
    //    col = pulse_mask;
}
//end progress + pulse masks

#if 1
// Attractors orbs
col = background * (1.0-col.a) * transitionToFinalPicture + col;
col = float4(col) * opacity;

//error mode
float3 errorCol = mix(float3(0.13,0.07,0.01), float3(0.85,0.34,0.0), lightMode); 
col.rgb = mix(col.rgb, errorCol * col.a, transitionToError); 


col *= mix(0.15, 1., progress_mask) + pulse_mask * 0.7;
col *= edge_blur_mask;
col.rgb += outline_col;
#endif
//col = float4(progress_mask, pulse_mask, 0 , 1);
//col.rgb = outline_col.rgb;

_output.color = col;

#pragma declaration

inline float2x2 rotate(float v) {
    float a = cos(v);
    float b = sin(v);
    return float2x2(a,-b,b,a);
}

//------------------------------------------------------
// Blob
//------------------------------------------------------
struct Blob {
    const float metaSmooth = 0.12;
    const float metaSize = 0.37;
    const float metaOffset = 0.18;
    const float offsetSpeed = 1.3;

    float smin(float a, float b, float k)
    {
        float h = max(k-abs(a-b), 0.0)/k;
        return min(a, b) - h*h*k*(1.0/4.0);
    }

    // Precomputed value before raymarch loop
    float2x2 rot;
    float4 metaPosSize[4];

    void init(float time) {
        rot = rotate(time*0.4*M_PI_2_F);

        // precalc metaball pos & size
        float ct = cos(time * offsetSpeed) * metaSize * metaOffset;
        float st = sin(time * offsetSpeed) * metaSize * metaOffset;
        metaPosSize[0] = float4( st*1.1, st,  0.0, metaSize * 1.15);
        metaPosSize[1] = float4(-st*1.1, st,  0.2, metaSize * 1.15);
        metaPosSize[2] = float4(     st, ct,-0.24,        metaSize);
        metaPosSize[3] = float4(     st,-ct,  0.1,        metaSize);
    }


    float map(float2 p) {
        float2 pp = rot * p;
        float d0 = length(pp - metaPosSize[0].xy) - metaPosSize[0].w;
        float d1 = length(pp - metaPosSize[1].xy) - metaPosSize[1].w;
        float d2 = length(pp - metaPosSize[2].xy) - metaPosSize[2].w;
        float d3 = length(pp - metaPosSize[3].xy) - metaPosSize[3].w;

        float d = smin(d0, d1, metaSmooth);
        d = smin(d,d2, metaSmooth);
        d = smin(d,d3, metaSmooth);

        return d;
    }

    float3 normal(float2 p, float d) {
        float2 eps = float2(.01, 0.);
        float3 n;
        n.x = d - map(p-eps.xy);
        n.y = d - map(p-eps.yx);
        return n /= eps.x*2.;
    }
};



#pragma arguments
float lightMode,
float radius,
float2 screenRatio,
float2 applePosition,
float transitionToBlob,
float2 blobPosition,
float blobDimensions,
float blobAnimationSpeed,
float appleScale,
float isHDR,
texture2d inSDF,
texture1d inRamp

#pragma body
constexpr sampler smp_repeat(filter::linear, address::repeat);
constexpr sampler smp_border_white(filter::linear, address::clamp_to_edge, border_color::opaque_white);
float time = vfx_frame.time;

float2 uv = _surface.diffuseTexcoord;
float2 effectPosition = mix(applePosition, blobPosition, transitionToBlob);
effectPosition.x *= -1.;
float2 appleScale2 = mix(appleScale, blobDimensions, transitionToBlob);
float2 UVapple = (uv - 0.5) + effectPosition ;
UVapple *= screenRatio;
UVapple /= appleScale2;
UVapple += 0.5;

half c = inSDF.sample(smp_border_white, float2(UVapple.x, UVapple.y)).x;

//gradient
const float texWidth = inSDF.get_width();
const float kStep = 8./texWidth;
const float2 eps = float2(kStep, 0.);
float2 grad =  float2(inSDF.sample(smp_border_white, UVapple + eps.xy).x - inSDF.sample(smp_border_white, UVapple - eps.xy).x,
                      inSDF.sample(smp_border_white, UVapple + eps.yx).x - inSDF.sample(smp_border_white, UVapple - eps.yx).x);
grad /= (2.*kStep); // normalize

// blob
if (transitionToBlob > 0.0001)
{
    float2 uvBlob = (float2(uv.x, uv.y) - 0.5) + float2(effectPosition.x, effectPosition.y);
    uvBlob.y = -uvBlob.y;
    uvBlob *= screenRatio;
    uvBlob /= blobDimensions;

    Blob blob;
    blob.init(time * blobAnimationSpeed);
    float blobD = blob.map(uvBlob);

    c = mix(c, half(blobD), half(transitionToBlob));
    grad = mix(grad, blob.normal(uvBlob, blob.map(uvBlob)).xy, transitionToBlob);
}

// ramp
float rampUV = atan2(grad.x, grad.y);
rampUV = (rampUV + M_PI_F) / (M_PI_F * 2);
rampUV += fract(time * 0.13);
float4 rampColor = inRamp.sample(smp_repeat, rampUV);
float colorMult = mix(1.1,1.1,lightMode);
//if (isHDR>0.5)
//    colorMult = mix(1.1,1.1,lightMode); //HDR
rampColor.rgb = pow(rampColor.rgb * colorMult, mix(0.6,0.7,lightMode));


// outline
half outlineWidth = radius;
half smooth = 20 / texWidth;
float outline = smoothstep(outlineWidth+0.h, outlineWidth-smooth, abs(c));

//trying to add the lighter border colors
outlineWidth *= 0.95;
float outline2 = 0.0 * smoothstep(outlineWidth + 0.001h, outlineWidth - 0.001h, abs(c)) * pow(smoothstep(outlineWidth - 0.05h, outlineWidth + 0.000h, abs(c)), 5.h);

float outline3 = 1 * smoothstep(outlineWidth + 0.001h, outlineWidth - 0.004h, abs(c)) * pow(smoothstep(outlineWidth - 0.14h, outlineWidth + 0.000h, abs(c)), 5.h);
outline3 = pow(outline3, 1.3);

outline2 += outline3;
float insideMult = mix(0.1, 0.3,lightMode);

//
outlineWidth *= 0.5;
if (lightMode < 0.5)
{
    rampColor.rgb *=  1 + 0.5 * outline2; 

    //outside ramp
    outline += pow(smoothstep(outlineWidth + 0.26h, outlineWidth - 0.01h, abs(c)), 3.9h) * 0.7; 
}
else
{
    rampColor.rgb *=  1 + 0.4 * outline2; 

    //outside ramp
    outline += pow(smoothstep(outlineWidth + 0.18h, outlineWidth - 0.01h, abs(c)), 3.5h) * 0.7; 
}


float4 out_color = float4(rampColor) *  saturate(outline);
_output.color = float4(out_color * pow(1-transitionToBlob, 2));
